import React, { useState, useEffect } from 'react';
import { Form, Button } from 'react-bootstrap';

const countries = [    "Afghanistan", "Albania", "Algeria", "Andorra", "Angola", "Antigua and Barbuda", "Argentina", "Armenia",
  "Australia", "Austria", "Azerbaijan", "Bahamas", "Bahrain", "Bangladesh", "Barbados", "Belarus", "Belgium",
  "Belize", "Benin", "Bhutan", "Bolivia", "Bosnia and Herzegovina", "Botswana", "Brazil", "Brunei", "Bulgaria",
  "Burkina Faso", "Burundi", "Cabo Verde", "Cambodia", "Cameroon", "Canada", "Central African Republic", "Chad",
  "Chile", "China", "Colombia", "Comoros", "Congo (Congo-Brazzaville)", "Costa Rica", "Croatia", "Cuba", "Cyprus",
  "Czechia (Czech Republic)", "Democratic Republic of the Congo", "Denmark", "Djibouti", "Dominica", "Dominican Republic",
  "Ecuador", "Egypt", "El Salvador", "Equatorial Guinea", "Eritrea", "Estonia", "Eswatini ", "Ethiopia",
  "Fiji", "Finland", "France", "Gabon", "Gambia", "Georgia", "Germany", "Ghana", "Greece", "Grenada", "Guatemala",
  "Guinea", "Guinea-Bissau", "Guyana", "Haiti", "Holy See", "Honduras", "Hungary", "Iceland", "India", "Indonesia",
  "Iran", "Iraq", "Ireland", "Israel", "Italy", "Jamaica", "Japan", "Jordan", "Kazakhstan", "Kenya", "Kiribati",
  "Kuwait", "Kyrgyzstan", "Laos", "Latvia", "Lebanon", "Lesotho", "Liberia", "Libya", "Liechtenstein", "Lithuania",
  "Luxembourg", "Madagascar", "Malawi", "Malaysia", "Maldives", "Mali", "Malta", "Marshall Islands", "Mauritania",
  "Mauritius", "Mexico", "Micronesia", "Moldova", "Monaco", "Mongolia", "Montenegro", "Morocco", "Mozambique",
  "Myanmar (formerly Burma)", "Namibia", "Nauru", "Nepal", "Netherlands", "New Zealand", "Nicaragua", "Niger",
  "Nigeria", "North Korea", "North Macedonia (formerly Macedonia)", "Norway", "Oman", "Pakistan", "Palau", "Palestine State",
  "Panama", "Papua New Guinea", "Paraguay", "Peru", "Philippines", "Poland", "Portugal", "Qatar", "Romania", "Russia",
  "Rwanda", "Saint Kitts and Nevis", "Saint Lucia", "Saint Vincent and the Grenadines", "Samoa", "San Marino",
  "Sao Tome and Principe", "Saudi Arabia", "Senegal", "Serbia", "Seychelles", "Sierra Leone", "Singapore", "Slovakia",
  "Slovenia", "Solomon Islands", "Somalia", "South Africa", "South Korea", "South Sudan", "Spain", "Sri Lanka",
  "Sudan", "Suriname", "Sweden", "Switzerland", "Syria", "Tajikistan", "Tanzania", "Thailand", "Timor-Leste", "Togo",
  "Tonga", "Trinidad and Tobago", "Tunisia", "Turkey", "Turkmenistan", "Tuvalu", "Uganda", "Ukraine", "United Arab Emirates",
  "United Kingdom", "United States", "Uruguay", "Uzbekistan", "Vanuatu", "Venezuela", "Vietnam", "Yemen",
  "Zambia", "Zimbabwe"]; 

  const roles = [ { id: 1, name: 'Admin' }, { id: 2, name: 'Usuario' } ]; // Ejemplo, reemplaza según corresponda

function AdministrarUsuarios() {
  const [usuarios, setUsuarios] = useState([]);
  const [cargando, setCargando] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchUsuarios();
  }, []);

  const fetchUsuarios = async () => {
    setCargando(true);
    try {
      const response = await fetch('http://localhost:8080/usuarios/detalles');
      if (!response.ok) throw new Error('Algo salió mal al obtener los usuarios');
      const data = await response.json();
      setUsuarios(data);
    } catch (error) {
      setError(error.message);
    } finally {
      setCargando(false);
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const formData = new FormData(event.target);
    const usuarioData = Object.fromEntries(formData.entries());

    try {
      const response = await fetch('http://localhost:8080/usuarios/crear', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(usuarioData),
      });

      if (!response.ok) throw new Error('Error al crear el usuario');
      fetchUsuarios(); // Refresh the list of users
    } catch (error) {
      setError(error.message);
    }
  };

  return (
    <div>
      <h2>Administrar Usuarios</h2>
      <Form onSubmit={handleSubmit}>
        <Form.Group>
          <Form.Label>Email</Form.Label>
          <Form.Control name="email" type="email" placeholder="Email" required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Contraseña</Form.Label>
          <Form.Control name="password" type="password" placeholder="Contraseña" required />
        </Form.Group>
        {/* Añade aquí los inputs para los otros campos */}
        <Form.Group>
          <Form.Label>Primer Nombre</Form.Label>
          <Form.Control name="primerNombre" placeholder="Primer Nombre" required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Segundo Nombre</Form.Label>
          <Form.Control name="segundoNombre" placeholder="Segundo Nombre" />
        </Form.Group>
        <Form.Group>
          <Form.Label>Apellido</Form.Label>
          <Form.Control name="primerApellido" placeholder="Primer Apellido" required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Segundo Apellido</Form.Label>
          <Form.Control name="segundoApellido" placeholder="Segundo Apellido" />
        </Form.Group>
        <Form.Group>
          <Form.Label>Fecha de Nacimiento</Form.Label>
          <Form.Control name="fechaNacimiento" type="date" required />
        </Form.Group>
        <Form.Group>
          <Form.Label>País de Origen</Form.Label>
          <Form.Select name="nacionalidad" required>
            <option>Seleccione un país</option>
            {countries.map((country) => (
              <option key={country} value={country}>{country}</option>
            ))}
          </Form.Select>
        </Form.Group>
        <Form.Group>
          <Form.Label>Número de Pasaporte</Form.Label>
          <Form.Control name="pasaporte" type="text" placeholder="Número de Pasaporte" required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Rol</Form.Label>
          <Form.Select name="rol" required>
            <option>Seleccione un rol</option>
            {roles.map((rol) => (
              <option key={rol.id} value={rol.id}>{rol.name}</option>
            ))}
          </Form.Select>
        </Form.Group>
        <Button variant="primary" type="submit">Crear Usuario</Button>
      </Form>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nombre Completo</th>
            <th>Email</th>
            <th>Rol</th>
            <th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {usuarios.map((usuario) => (
            <tr key={usuario.id}>
              <td>{usuario.id}</td>
              <td>{`${usuario.primerNombre} ${usuario.primerApellido}`}</td>
              <td>{usuario.email}</td>
